import React from "react";
import styled from "styled-components";

const FileArea = styled.div`
  position: absolute;
  top: 500px;
  width: 100px;
  height: 500px;
  background-color: red;
`;

const EventSelect = () => {
  return <FileArea></FileArea>;
};

export default EventSelect;
